import React from 'react';
import './glass.css';

function GlassmorphismBox() {
  return (
    <div className="glassmorphism-box">
      <h1>Glassmorphism Box</h1>
      <p>This is a glassmorphism box created using CSS and React.</p>
    </div>
  );
}

export default GlassmorphismBox;
